import React from 'react';
import { MDBTable, MDBTableBody, MDBTableHead } from 'mdbreact';
import '@fortawesome/fontawesome-free/css/all.min.css';

const StockTable = (props) => {
    const {stock} = props;
    
    return <MDBTable>
        <MDBTableHead>
            <tr>
                <td>Analytic</td>
                <td>Value</td>
            </tr>
        </MDBTableHead>
        <MDBTableBody>

        </MDBTableBody>
    </MDBTable>
}

export default StockTable;
